    const id =  select_row()
    try {
        const response = await fetch(endpoint+"/"+id, {
            method: 'DELETE'
        })
        if (response.ok){
            updateTable()
            console.log("Seeding job removed!");
        }

    }catch (error){
        throw error
    }
}

